import React from 'react';
import './Dashboard.css';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h2>Dashboard</h2>
      <div className="stats">
        <div className="stat">
          <h3>Total Orders</h3>
          <p>120</p>
        </div>
        <div className="stat">
          <h3>Total Revenue</h3>
          <p>$3,540</p>
        </div>
        <div className="stat">
          <h3>Total Reservations</h3>
          <p>45</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
